export default function Cadastro(){
    return(
        <div>
            <h2>Novo contato</h2>
            <label>Informe o nome</label>
            <input type="text" placeholder="Informe o nome"/>
            
            <label>Informe o email</label>
            <input type="text" placeholder="Informe o nome"/>
            
            <label>Informe o telefone</label>
            <input type="text" placeholder="Informe o nome"/>
        </div>
    )
}
